(68, 'DEV', 'DEV68', 3, 4, 10000, 0, 10000, 11654, '在创建事项的表单中,当变更事项类型时，原先填写的数据要保留', '###当前步骤或情况：\r\n  1. 进入事项列表页面\r\n  2. 打开创建事项表单，此时默认事项类型为bug,并输入标题:xxxxx\r\n  3. 变更事项类型为 新功能 \r\n  4. 之前输入的标题变成了空\r\n  \r\n### 优化后的步骤或结果：\r\n  1. 进入事项列表页面\r\n  2. 打开创建事项表单，此时默认事项类型为bug,并输入标题:xxxxx\r\n  3. 变更事项类型为 新功能 \r\n  4. 之前输入的标题内容仍然保留\r\n\r\n', '', 3, 0, 1, 1540958040, 0, '2018-10-31', '2018-11-05', NULL, 11, NULL, 3, 0, 0, 1700000, '', 0, 0),
