(70, 'DEV', 'DEV70', 3, 3, 10000, 10000, 10000, 11657, '在wiki上编写使用指南', '参考 \r\nhttps://panjiachen.github.io/vue-element-admin-site/zh/guide/#%E5%8A%9F%E8%83%BD\r\nhttps://doc.fastadmin.net/docs/install.html#%E5%91%BD%E4%BB%A4%E8%A1%8C%E5%AE%89%E8%A3%85-3\r\nhttps://ant.design/index-cn\r\n\r\n内容和结构\r\n\r\n- Masterlab 如何进行高效的项目管理和团队协作\r\n- 项目角色定义\r\n- 工作流和方案\r\n- 事项类型及方案\r\n- 最佳实践，创建组织或产品,创建项目,项目设置，添加事项，创建迭代，跟踪和管理迭代，数据和图表分析，交付产品\r\n- 快捷键\r\n- 其他配置\r\n- 定制或二次开发\r\n- 常见问题\r\n\r\n', '', 3, 0, 1, 1540969482, 0, '2018-10-31', '2018-11-05', NULL, 0, NULL, 3, 0, 0, 1800000, '', 0, 0),
