INSERT INTO `project_main` (`id`, `org_id`, `org_path`, `name`, `url`, `lead`, `description`, `key`, `pcounter`, `default_assignee`, `assignee_type`, `avatar`, `category`, `type`, `type_child`, `permission_scheme_id`, `workflow_scheme_id`, `create_uid`, `create_time`, `detail`, `un_done_count`, `done_count`, `closed_count`) VALUES
(1, 1, 'default', '客户管理crm系统', '', 10000, '                                                                                                                                                                                                                基于人工智能的客户关系管理系统                                                                                                                                                                                                ', 'CRM', NULL, 1, NULL, 'avatar/20181017/20181017180352_48634.jpg', 0, 10, 0, 0, 0, 10000, 1536553005, 'CRM(Customer Relationship Management\r\n\r\n客户关系管理，是一种以\"客户关系一对一理论\"为基础，旨在改善企业与客户之间关系的新型管理机制。客户关系管理的定义是：企业为提高核心竞争力，利用相应的信息技术以及互联网技术来协调企业与顾客间在销售、营销和服务上的交互，从而提升其管理方式，向客户提供创新式的个性化的客户交互和服务的过程。其最终目标是吸引新客户、保留老客户以及将已有客户转为忠实客户，增加市场份额。\r\n\r\n最早发展客户关系管理的国家是美国，这个概念最初由Gartner Group提出来，在1980年初便有所谓的“接触管理”(Contact Management)，即专门收集客户与公司联系的所有信息，到1990年则演变成包括电话服务中心支持资料分析的客户关怀（Customer care）。开始在企业电子商务中流行。\r\n\r\nCRM系统的宗旨是：为了满足每个客户的特殊需求，同每个客户建立联系，通过同客户的联系来了解客户的不同需求，并在此基础上进行\"一对一\"个性化服务。通常CRM包括销售管理、市场营销管理、客户服务系统以及呼叫中心等方面。\r\n“以客户为中心”，提高客户满意度，培养、维持客户忠诚度，在今天这个电子商务时代显得日益重要。客户关系管理正是改善企业与客户之间关系的新型管理机制，越来越多的企业运用CRM来增加收入、优化赢利性、提高客户满意度。\r\n\r\n统计数据表明，2008年中小企业CRM市场的规模已达8亿美元。在随后五年中，这一市场将快速增长至18亿美元，在整个CRM市场中占比达30%以上。 \r\n\r\nCRM系统主要包含传统CRM系统和在线CRM系统。', 1, 2, 2),
(2, 1, 'default', 'ERP系统实施', '', 10000, '                                                    公司内部ERP项目的实施                                                ', 'ERP', NULL, 1, NULL, 'avatar/20180913/20180913144752_28827.jpg', 0, 10, 0, 0, 0, 10000, 1536821242, '收藏 8742\r\n968\r\nERP系统 编辑\r\nERP系统是企业资源计划(Enterprise Resource Planning )的简称，是指建立在信息技术基础上，集信息技术与先进管理思想于一身，以系统化的管理思想，为企业员工及决策层提供决策手段的管理平台。它是从MRP（物料需求计划）发展而来的新一代集成化管理信息系统，它扩展了MRP的功能，其核心思想是供应链管理。它跳出了传统企业边界，从供应链范围去优化企业的资源，优化了现代企业的运行模式，反映了市场对企业合理调配资源的要求。它对于改善企业业务流程、提高企业核心竞争力具有显著作用。\r\n\r\n系统特点编辑\r\nERP是Enterprise Resource Planning（企业资源计划）的简称，是上个世纪90年代美国一家IT公司根据当时计算机信息、IT技术发展及企业对供应链管理的需求，预测在今后信息时代企业管理信息系统的发展趋势和即将发生变革，而提出了这个概念。 ERP是针对物资资源管理（物流）、人力资源管理（人流）、财务资源管理（财流）、信息资源管理（信息流）集成一体化的企业管理软件。它将包含客户/服务架构，使用图形用户接口，应用开放系统制作。除了已有的标准功能，它还包括其它特性，如品质、过程运作管理、以及调整报告等。\r\nERP系统的特点有：\r\n企业内部管理所需的业务应用系统，主要是指财务、物流、人力资源等核心模块。\r\n\r\n物流管理系统采用了制造业的MRP管理思想；FMIS有效地实现了预算管理、业务评估、管理会计、ABC成本归集方法等现代基本财务管理方法；人力资源管理系统在组织机构设计、岗位管理、薪酬体系以及人力资源开发等方面同样集成了先进的理念。\r\nERP系统是一个在全公司范围内应用的、高度集成的系统。数据在各业务系统之间高度共享，所有源数据只需在某一个系统中输入一次，保证了数据的一致性。\r\n对公司内部业务流程和管理过程进行了优化，主要的业务流程实现了自动化。\r\n采用了计算机最新的主流技术和体系结构：B/S、INTERNET体系结构，WINDOWS界面。在能通信的地方都可以方便地接入到系统中来。\r\n集成性、先进性、统一性、完整性、开放性。\r\n实用性\r\nERP系统实际应用中更重要的是应该体现其“管理工具”的本质。ERP系统主要宗旨是对企业所拥有的人、财、物、信息、时间和空间等综合资源进行综合平衡和优化管理，ERP软件协调企业各管理部门，ERP系统围绕市场导向开展业务活动，提高企业的核心竞争力，ERP软件从而取得最好的经济效益。所以，ERP系统首先是一个软件，同时是一个管理工具。ERP软件是IT技术与管理思想的融合体，ERP系统也就是先进的管理思想借助电脑，来达成企业的管理目标。\r\n整合性\r\nERP最大特色便是整个企业信息系统的整合，比传统单一的系统更具功能性。\r\n弹性\r\n采用模块化的设计方式，使系统本身可因应企业需要新增模块来支持并整合，提升企业的应变能力。\r\n数据储存\r\n将原先分散企业各角落的数据整合起来，使数据得以一致性，并提升其精确性。\r\n便利性\r\n在整合的环境下，企业内部所产生的信息透过系统将可在企业任一地方取得与应用。\r\n管理绩效\r\nERP系统将使部分间横向的联系有效且紧密，使得管理绩效提升。\r\n互动关系\r\n透过ERP系统配合使企业与原物料供货商之间紧密结合，增加其市场变动的能力。而CRM客户关系管理系统则使企业充分掌握市场需要取向的动脉，两者皆有助于促进企业与上下游的互动发展关系。\r\n实时性\r\nERP是整个企业信息的整合管理，重在整体性，而整体性的关键就体现于“实时和动态管理”上，所谓“兵马未动，粮草先行”，强调的就是不同部门的“实时动态配合”，现实工作中的管理问题，也是部门协调与岗位配合的问题，因此缺乏“实时动态的管理手段和管理能力”的ERP管理，就是空谈。\r\n及时性\r\nERP管理的关键是“现实工作信息化”，即把现实中的工作内容与工作方式，用信息化的手段来表现，因为人的精力和能力是有限的，现实事务达到一定的繁杂程度后，人就会在所难免的出错，将工作内容与工作方式信息化，就能形成ERP管理的信息化体系，才能拥有可靠的信息化管理工具。', 1, 0, 1),
(3, 1, 'default', 'Masterlab-Development', 'http://www.masterlab.vip/about.php', 10000, 'Masterlab的项目管理', 'DEV', NULL, 1, NULL, 'avatar/20181015/20181015102601_18003.png', 0, 10, 0, 0, 0, 10000, 1539089761, ':tw-1f41d:Masterlab\r\nMasterLab是公司的核心产品和服务平台,帮助团队随时随地的，专注的管理和参与项目，实现目标，成就伟大产品!\r\n\r\n \r\n\r\nMasterLab由来, master为“主人，教练”译义，而产品经理和项目经理是产品设计和项目研发过程中的关键角色，lab为“实验室”译义；我们期望他们的工作就像在呆实验室一样，轻松的，简单\r\n\r\n \r\n\r\nlogo设计创意：当我们走在花丛中,看着翩翩起舞的蝴蝶会惊羡于她们的美丽,可鲜为人知的是一只只蝴蝶卵需要在黑暗而密闭的蛹经历数白日的煎熬,才能破茧成蝶,凤凰涅槃。这恰恰就是一个成功产品经历的过程。 一只南美洲亚马逊河流域热带雨林中的蝴蝶，偶尔扇动几下翅膀，可以在两周以后引起美国德克萨斯州的一场龙卷风，这就是蝴蝶效应。 蝴蝶互动的精神也是这样，我们只要轻扇翅膀，就能引起一场互联网的风暴。\r\n\r\n', 27, 43, 58),
